void load_real_trace(const char* file_name)
{
    std::string in_trace_file_name;
    in_trace_file_name.append(file_name);
    in_trace_file_name.append(".id_size_list.dat");
    
    FILE * fp_in_trace = fopen(in_trace_file_name.c_str(), "rb");
    if (!fp_in_trace)
    {
        printf("ERROR: Cannot load id_size file %s\n", in_trace_file_name.c_str());
    }
    else
    {
        printf("INFO: Loading trace id size from file %s \n", in_trace_file_name.c_str());
        // clean list
        id_size_list.clear();
        g_trace_flow_number = 0;
        g_trace_packet_number = 0;
        pkt_idsz current_packet;
        pkt_idsz_in_file cur_pkt_fl;
        while (fread(&cur_pkt_fl, sizeof(pkt_idsz_in_file), 1, fp_in_trace) == 1)
        {
            current_packet.id = cur_pkt_fl.id;
            current_packet.len = cur_pkt_fl.len;
            // get one packet
            id_size_list.push_back(current_packet);
            g_trace_packet_number++;
            if (current_packet.id >= g_trace_flow_number)
                g_trace_flow_number++;
//          if (g_trace_packet_number > 20000000)
//              break;
        }

        printf("INFO: load %d packets, %d flows, from file %s \n", g_trace_packet_number, g_trace_flow_number, in_trace_file_name.c_str());
    }

}

void save_txt_matlab_file(const char* file_name)
{
    std::string out_trace_file_name;
    out_trace_file_name.append(file_name);
    out_trace_file_name.append("id_size_list.txt");

    FILE * fp_id_size_list = fopen(out_trace_file_name.c_str(), "wb");
    fprintf(fp_id_size_list,    "#ifndef __TRACE_H__\r\n"
                                "#define __TRACE_H__\r\n"
                                "/*Trace info: packet = 10000, flow=*/\r\n"
                                "/*uint32_t flow_id, uint32_t pkt_size*/\r\n");
    fprintf(fp_id_size_list, "const uint32_t trace_data = [\r\n");
    if (!fp_id_size_list)
    {
        printf("ERROR: Cannot write id_size_list to file %s\n", out_trace_file_name.c_str());
    }
    else
    {
        int tmp_cnt = 0;
        int max_id = 0;
        for (std::list<pkt_idsz>::iterator it_list = id_size_list.begin(); it_list != id_size_list.end(); it_list++)
        {
            tmp_cnt++;
            //fwrite(&(*it_list), sizeof(pkt_idsz), 1, fp_id_size_list);
            fprintf(fp_id_size_list, "%d,\t%d,\t", (*it_list).id, (*it_list).len);
            if ((*it_list).id > max_id)
                max_id = (*it_list).id;
            if (tmp_cnt%8 == 0)
                fprintf(fp_id_size_list, "\r\n");
            if (tmp_cnt == 10000)
                break;
        }
        fprintf(fp_id_size_list, "];\r\n");
        fprintf(fp_id_size_list, "#endif\r\n");
        fprintf(fp_id_size_list, "/*max_id = %d*/\r\n",max_id);
        printf("INFO: Trace id size text write done, %d packets write.\n", tmp_cnt);
        fclose(fp_id_size_list);
    }
}

